configure:
  commands:
    end:
      new_state: execute
    ipv6 access-list acl_4: "ipv6 access-list acl_4\r\n"
    line console 0:
      new_state: configure_line
    no logging console: ''
    permit ipv6 2001:1::/64 any sequence 10: "permit ipv6 2001:1::/64 any sequence\
      \ 10\r\n"
  prompt: Starfleet(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: Starfleet(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: Starfleet#
